tables.table_schema:
CREATE TABLE customer_preferences (
	customer_id INT PRIMARY KEY,
	product_id INT,
	rating INT,
	feedback TEXT
);

CREATE TABLE market_analysis (
	analysis_id INT PRIMARY KEY,
	analysis_date DATE,
	preferred_product VARCHAR(255),
	forecasts TEXT
);

CREATE TABLE ForecastData (
   id INT PRIMARY KEY,
   forecast_date DATE,
   product_id INT,
   demand_forecast INT
);

CREATE TABLE Product (
   id INT PRIMARY KEY,
   name VARCHAR(100),
   category VARCHAR(50),
   price DECIMAL(10, 2),
   quantity INT
);

CREATE TABLE Supplier (
   id INT PRIMARY KEY,
   name VARCHAR(100),
   location VARCHAR(100),
   contact VARCHAR(20)
);

CREATE TABLE MarketTrends (
   date DATE,
   trend_description TEXT
);

CREATE TABLE CustomerFeedback (
   id INT PRIMARY KEY,
   customer_id INT,
   product_id INT,
   rating INT,
   feedback TEXT
);

CREATE TABLE DemandForecast (
   id INT PRIMARY KEY,
   product_id INT,
   date DATE,
   projected_demand INT
);
